import React from 'react'
import {useRoutes} from 'react-router-dom'
import routes from './routes/routes'
import Navbar from './components/Navbar'
import './App.css'

const App=()=>{

    const elements=useRoutes(routes);
    return(
        <div className='app'>
            <Navbar/>
            {elements}
            <div>
                {/* <Purpose/>
                <Contact/>
                <Footer/> */}
            </div>
        </div>
    )
}
export default App
